INSERT INTO `ads` VALUES (20,2,'Bahawalpur','3','3','4','10000','yes','no','yes','2023-07-06 15:24:58','2023-07-06 15:26:36','Lying amongst the arid landscapes of the Cholistan Desert, close to the border with neighbouring India, Bahawalpur once lay at the heart of a princely state that formed part of the Rajputana States that stretched across Rajasthan in neighbouring India.','storage/images/1688675098.jpeg',NULL,'2023-11-30'),(21,2,'Chitral','7','6','6','25000','yes','no','yes','2023-07-06 15:25:23','2023-07-06 15:42:24','Nestled within a fertile valley beneath the mighty Tirich Mir - at 7,700m the highest mountain in the Hindu Kush - Chitral Town is a cosy place, inhabited by warm and welcoming people. A lively bazaar, many of the stalls and restaurants run by Afghan refugees, leads through its centre to the small airstrip at one end and the polo field at the other.','storage/images/1688676144.jpeg',NULL,'2023-11-30'),(22,2,'Deosai National Park','3','3','6','35000','yes','yes','yes','2023-07-06 15:25:28','2023-07-06 15:43:28','Renowned for its rich flora and fauna, the Deosai Plains lie along the alpine steppes of the Karakoram-West Tibetan Plateau. During the spring, these fertile plains are blanketed in millions of colourful wildflowers that attract a vast army of butterflies to their dazzling blooms.','storage/images/1688676208.jpeg',NULL,'2023-11-30'),(23,4,'Fairy Meadows','10','9','9','45000','yes','yes','no','2023-07-06 15:51:09','2023-07-06 15:51:09','Pakistan is blessed with areas of matchless beauty and Fairy Meadows can easily be considered one of the most beautiful locations in the region and is an absolute must on the list of places to visit in Pakistan.','storage/images/1688676669.jpeg',NULL,'2023-12-30'),(24,4,'Gilgit','7','7','7','50000','yes','yes','yes','2023-07-06 15:52:07','2023-07-06 15:52:07','Gilgit, found within Gilgit Baltistan region, is certainly no postcard town. Encircled by stark black mountains it carries the oppressive feeling of a place cut off from the rest of the world.','storage/images/1688676726.jpeg',NULL,'2023-12-30'),(25,4,'Gilgit','7','7','7','50000','yes','yes','yes','2023-07-06 15:54:18','2023-07-06 15:54:27','Gilgit, found within Gilgit Baltistan region, is certainly no postcard town. Encircled by stark black mountains it carries the oppressive feeling of a place cut off from the rest of the world.','storage/images/1688676858.jpeg','2023-07-06 15:54:27','2023-12-30'),(26,4,'Hunza','10','10','10','60000','yes','no','yes','2023-07-06 15:56:03','2023-07-06 15:56:03','The area known as Hunza lies on the ancient Silk Road to Kashgar and today the Karakoram Highway follows the same route, with Karimabad being the region\'s main town. This small, mountainous region was, until recently, a semi-autonomous state but is now fully unified with Pakistan.','storage/images/1688676963.jpeg',NULL,'2024-01-31'),(27,3,'Islamabad','10','10','15','75000','no','yes','yes','2023-07-06 16:00:20','2023-07-06 16:00:20','Islamabad has been the capital of Pakistan since 1967 when it moved from Karachi. As a relatively young city compared with others in the country, Islamabad does suffer from being somewhat sterile and characterless, and in all honesty is usually only used as a gateway to the rest of the country, but it is a good place from which to visit the bustling bazaars of Rawalpindi and the Buddhist ruins at Taxila and does boast some interesting sites such as the Faisal Mosque.','storage/images/1688677220.jpeg',NULL,'2024-03-30'),(28,3,'Karachi','3','3','4','30000','yes','yes','yes','2023-07-06 16:01:07','2023-07-06 16:01:07','Pakistan’s most populous and most cosmopolitan city, Karachi lies on the shores of the Arabian Sea. Home to two of the country’s busiest seaports, it began life as a fortified settlement in the early years of the 18th century, before going on to play a major role in British India before Partition.','storage/images/1688677267.jpeg',NULL,'2024-03-30'),(29,3,'Khaplu','3','3','2','10000','yes','yes','yes','2023-07-06 16:01:50','2023-07-06 16:01:50','Khaplu is a beautiful village just a few miles east of Skardu with picturesque terraced fields growing all sorts of crops. Khaplu was once a famous and wealthy kingdom and the Khaplu Palace was once the residential fort of the local ruler. Recently the Aga Khan showed interest in the palace, which has now been renovated into an exquisite hotel where our guests will stay.','storage/images/1688677310.jpeg',NULL,'2024-03-30'),(30,5,'Khunjerab Pass','15','15','15','100000','yes','no','yes','2023-07-06 16:05:40','2023-07-06 16:05:40','The highest point on the famous Karakoram Highway and the highest paved border crossing in the world, the Khunjerab Pass lies at a lofty 4,693 metres, straddling the frontier between Pakistan and the Xinjiang Autonomous Region of China.','storage/images/1688677540.jpeg',NULL,'2024-07-27'),(31,5,'Lahore','2','2','3','4500','yes','no','yes','2023-07-06 16:06:32','2023-07-06 16:06:32','Other than the many famous historical monuments, this city, the second largest in Pakistan, is also known for its beautiful gardens laid out during the Moghal Empire and the British Raj. Its faded elegance, busy streets and bazaars and wide variety of Islamic and British architecture, make it a city full of atmosphere, contrast and surprise.','storage/images/1688677592.jpeg',NULL,'2024-07-27'),(32,5,'Larkana','2','2','6','39000','yes','no','yes','2023-07-06 16:08:01','2023-07-06 16:08:01','With a history that stretches back millennia, Larkana is home to the ancient site of Mohenjo-daro, once one of the largest settlements of the Bronze Age civilisation that occupied the Indus Valley around 2500 BC.','storage/images/1688677681.jpeg',NULL,'2024-07-27'),(33,6,'Peshawar','5','5','20','35000','yes','no','yes','2023-07-07 05:40:14','2023-07-07 05:40:14','asjii jpajsopdj opwqjpo japosd','storage/images/1688726414.jpeg',NULL,'2023-07-08'),(34,2,'Islamabad','9','8','10','30000','yes','no','yes','2023-07